# Given a string, find the length of the longest substring without repeating characters.
# Examples:
# Given "abcabcbb", the answer is "abc", which the length is 3.
# Given "bbbbb", the answer is "b", with the length of 1.
# Given "pwwkew", the answer is "wke", with the length of 3. Note that the answer must be a substring, "pwke" is a subsequence and not a substring.

# Bruteforce, O(n^2)
# @param {String} s
# @return {Integer}
# def length_of_longest_substring(s)
#   longest = ''
#   (0..s.size - 1).each do |i|
#     # break if s.size - i + 1 < longest.size
#     curr = s[i]
#     (i + 1..s.size - 1).each do |j|
#       if curr.chars.include?(s[j])
#         break
#       else
#         curr = s[i..j]
#       end
#     end
#     if curr.size > longest.size
#       longest = curr
#     end
#   end
#   longest.size
# end


def next_substr(prev_substr, char)
  return nil if prev_substr.size == 0
  if prev_substr.include?(char)
    next_substr(prev_substr[1..-1], char)
  else
    prev_substr
  end
end

# O(n)
def length_of_longest_substring(s)
  return 0 if s.size == 0
  substrs = []
  (0..s.size - 1).each do |i|
    if substrs.empty?
      substrs[0] = s[i]
    else
      prev_substr = substrs[-1]
      if prev_substr.include?(s[i])
        n = next_substr(prev_substr[1..-1], s[i])
        n.nil? ? substrs.push(s[i]) : substrs.push(n + s[i])
      else
        prev_substr << s[i]
      end
    end
  end
  substrs.max_by(&:size).size
end

p length_of_longest_substring('abcabcbb') #=> abc 3
p length_of_longest_substring('bbbbb') #=> b 1
p length_of_longest_substring('pwwkew') #=> wke 3
p length_of_longest_substring('au') #=> au 2
p length_of_longest_substring('c') #=> c 1
p length_of_longest_substring('') #=> '' 0
p length_of_longest_substring('dvdf') #=> dvdf 3

